package com.ww.leetcode.topInter150.hashmap;

import java.util.HashMap;
import java.util.Iterator;
import java.util.Map;

/**
 * @since 2025/1/13 13:37
 */
public class ValidAnagram242 {

    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }

        char[] sChar = s.toCharArray();
        Map<Character, Integer> sMap = new HashMap<>();
        for (char sch : sChar) {
            sMap.put(sch, sMap.getOrDefault(sch, 0) + 1);
        }

        char[] tChar = t.toCharArray();
        Map<Character, Integer> tMap = new HashMap<>();
        for (char tch : tChar) {
            tMap.put(tch, tMap.getOrDefault(tch, 0) + 1);
        }

        Iterator<Character> sIterator = sMap.keySet().iterator();
        while (sIterator.hasNext()) {
            char sch = sIterator.next();
            Integer sInt = sMap.getOrDefault(sch, 0);
            Integer tInt = tMap.getOrDefault(sch, 0);
            if (sInt.intValue() != tInt.intValue()) {
                return false;
            }
        }

        Iterator<Character> tIterator = tMap.keySet().iterator();
        while (tIterator.hasNext()) {
            char tch = tIterator.next();
            Integer sInt = sMap.getOrDefault(tch, 0);
            Integer tInt = tMap.getOrDefault(tch, 0);
            if (sInt.intValue() != tInt.intValue()) {
                return false;
            }
        }

        return true;
    }

    public static void main(String[] args) {
        System.out.println(new ValidAnagram242().isAnagram("",
                ""));
    }

}
